import React from 'react';
import { Routes, MemoryRouter } from 'react-router-dom';
import './App.css';
import Provedor from './contexto/Provedor';
import PaginaPrincipal from './paginas/PaginaPrincipal';

function App() {
  return (
    <Provedor>
      <MemoryRouter>
        <Routes exact path="/principal" element={ PaginaPrincipal } />
      </MemoryRouter>
    </Provedor>
  );
}

export default App;
